import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Question({getQuestionId}) {

    const q = getQuestionId(id => q.id);
    console.log();

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.id}</p>
        </Paper>
    )
}
